import React, { Component } from "react";
import "../css/App.css";

class Dashboard extends Component {
  logOutHandler() {
    ApiService.logout()
      .then(response => {
        if (response.status === 200) {
          this.props.history.push("/")
        }
      })
      .catch(error => {
        if (error.response.status === 500) {
          this.setState({
            message: `Wrong username and password. Please try again.`
          });
        } else {
          console.log("Unavailable !");
        }
      });  
  }
  render() {
    return (
      <div>
        <section className="breadcrumb-osahan pt-5 pb-5 bg-dark position-relative text-center">
          <h1 className="text-white">Dashboard</h1>
          <h6 className="text-white-50">Dasbboard</h6>
          <h1 onClick={this.logoutHandler}>Logout</h1>
        </section>
      </div>
    );
  }
}

export default Dashboard;
